import React, { useState } from "react";
import { Grid, Card, CardContent, Typography, Button } from "@mui/material";
import { useNavigate } from "react-router-dom";

const testProducts = [
  { id: 1, name: "Air Max 90", price: 120, link: "/placeholder.jpg" },
  { id: 2, name: "Superstar", price: 100, link: "/placeholder.jpg" },
  { id: 3, name: "Cortez", price: 110, link: "/placeholder.jpg" }
];

export default function ProductList() {
  const [products] = useState(testProducts);
  const navigate = useNavigate();

  return (
    <Grid container spacing={2} sx={{ p: 2 }}>
      {products.map((p) => (
        <Grid item xs={12} sm={6} md={4} key={p.id}>
          <Card>
            <CardContent>
              <Typography variant="h6">{p.name}</Typography>
              <Typography variant="body2">{p.price} €</Typography>
              <Button onClick={() => navigate(`/product/${p.id}`)}>
                Voir détails
              </Button>
            </CardContent>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
}
